import React from "react";
import { Modal, Button } from "react-bootstrap";
import { render } from "react-dom";

const MyModal =(props)=>{
    let show = props.setShow;
    const handleClose=()=>{
        show=false;
    }
        return(
            <Modal
            show={show}
            onHide={handleClose}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>Modal title</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <textarea id="text_area" defaultValue="input heare..."></textarea>
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={handleClose}>
                Close
              </Button>
              <Button variant="primary" onClick={()=>{
                  console.log(document.getElementById.text_area);
              }}>Understood</Button>
            </Modal.Footer>
          </Modal>
        )
}

export default MyModal;
